import React, { useState } from 'react';
import {Navbar} from '../layout';
import './dashboard.css'

// main dashboard function
function Dashboard() {
    return (<>
        <div className='dashboard'>
            <Navbar/>
            <div className='dashboardCard profileCard'></div>
        </div>
    </>);
}




export default Dashboard;
